import React from 'react'
import { Button, Form, Grid, Header, Image, Message, Segment, Input, Label, Divider } from 'semantic-ui-react'
// import testChildComponent   from './testChildComponent'

const InputTag = ({ dataObj, handleChange, state }) => {

const stateKey = dataObj.name
    return (

        <Form.Field>
          <Label fluid>{dataObj.label}</Label>
          <Input focus fluid data-category={dataObj.category} name={dataObj.name} value={state.stateKey} onChange={handleChange}  />
        </Form.Field>

    )

  }

export default InputTag
